        fieldicon:'',
        explanation_d:'<SPAN style=\"COLOR: black; FONT-FAMILY: \'Arial\',\'sans-serif\'\"><FONT size=3>A new entry is also created under Means of Transport. Two means of transport are allowed for this transportation lane (<B style=\"mso-bidi-font-weight: normal\">Z_FRU_BIG4</B> and <B style=\"mso-bidi-font-weight: normal\">Z_FRU_SM4</B>).<?xml:namespace prefix = o ns = \"urn:schemas-microsoft-com:office:office\" /><o:p></o:p></FONT></SPAN> \n<P></P>\n<P><SPAN style=\"COLOR: black; FONT-FAMILY: \'Arial\',\'sans-serif\'\"><FONT size=3>It is important to consider the following:<o:p></o:p></FONT></SPAN></P>\n<P style=\"MARGIN-LEFT: 36pt; TEXT-INDENT: -18pt; mso-list: l0 level1 lfo1\"><SPAN style=\"COLOR: black; FONT-FAMILY: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol\"><SPAN style=\"mso-list: Ignore\"><FONT size=3>·</FONT><SPAN style=\"FONT: 7pt \'Times New Roman\'\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </SPAN></SPAN></SPAN><SPAN style=\"COLOR: black; FONT-FAMILY: \'Arial\',\'sans-serif\'\"><FONT size=3>Activate the flag for <B style=\"mso-bidi-font-weight: normal\">detailed planning</B>, because&nbsp;you are looking at means of transport used for TP/VS. On the other hand aggregated planning would be used for SNP planning.<o:p></o:p></FONT></SPAN></P>\n<P style=\"MARGIN-LEFT: 36pt; TEXT-INDENT: -18pt; mso-list: l0 level1 lfo1\"><SPAN style=\"COLOR: black; FONT-FAMILY: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol\"><SPAN style=\"mso-list: Ignore\"><FONT size=3>·</FONT><SPAN style=\"FONT: 7pt \'Times New Roman\'\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </SPAN></SPAN></SPAN><SPAN style=\"COLOR: black; FONT-FAMILY: \'Arial\',\'sans-serif\'\"><FONT size=3>The <B style=\"mso-bidi-font-weight: normal\">transportation calendar</B> is entered (<STRONG>FRU_CAL</STRONG>).<o:p></o:p></FONT></SPAN></P>\n<P style=\"MARGIN-LEFT: 36pt; TEXT-INDENT: -18pt; mso-list: l0 level1 lfo1\"><SPAN style=\"COLOR: black; FONT-FAMILY: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol\"><SPAN style=\"mso-list: Ignore\"><FONT size=3>·</FONT><SPAN style=\"FONT: 7pt \'Times New Roman\'\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </SPAN></SPAN></SPAN><FONT size=3><SPAN style=\"COLOR: black; FONT-FAMILY: \'Arial\',\'sans-serif\'\">A long <B style=\"mso-bidi-font-weight: normal\">validity period</B> is chosen </SPAN><SPAN style=\"FONT-FAMILY: \'Arial\',\'sans-serif\'\">(<STRONG>01.01.1970-31.12.2100</STRONG>). <SPAN style=\"COLOR: black\"><o:p></o:p></SPAN></SPAN></FONT></P>\n<P style=\"MARGIN-LEFT: 36pt; TEXT-INDENT: -18pt; mso-list: l0 level1 lfo1\"><SPAN style=\"COLOR: black; FONT-FAMILY: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol\"><SPAN style=\"mso-list: Ignore\"><FONT size=3>·</FONT><SPAN style=\"FONT: 7pt \'Times New Roman\'\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </SPAN></SPAN></SPAN><FONT size=3><B style=\"mso-bidi-font-weight: normal\"><SPAN style=\"COLOR: black; FONT-FAMILY: \'Arial\',\'sans-serif\'\">Retention period</SPAN></B><SPAN style=\"COLOR: black; FONT-FAMILY: \'Arial\',\'sans-serif\'\"> is entered (<STRONG>10 minutes</STRONG>). This is used to model additional&nbsp; duration for the trucks. <o:p></o:p></SPAN></FONT></P>\n<P style=\"MARGIN-LEFT: 36pt; TEXT-INDENT: -18pt; mso-list: l0 level1 lfo1\"><SPAN style=\"COLOR: black; FONT-FAMILY: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol\"><SPAN style=\"mso-list: Ignore\"><FONT size=3>·</FONT><SPAN style=\"FONT: 7pt \'Times New Roman\'\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </SPAN></SPAN></SPAN><SPAN style=\"COLOR: black; FONT-FAMILY: \'Arial\',\'sans-serif\'\"><FONT size=3>The<B style=\"mso-bidi-font-weight: normal\"> means of transport cost </B>is entered (<STRONG>0,9</STRONG> for <SPAN style=\"mso-spacerun: yes\">&nbsp;</SPAN>Z_FRU_BIG4 and <STRONG>0,7</STRONG> for Z_FRU_SM4).<B style=\"mso-bidi-font-weight: normal\"> </B><o:p></o:p></FONT></SPAN></P>\n<P><SPAN style=\"FONT-SIZE: 11pt; COLOR: black; LINE-HEIGHT: 115%; FONT-FAMILY: \'Arial\',\'sans-serif\'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA\"><FONT size=3>A proposal is generated and the transportation distance and duration is automatically calculated.</FONT></SPAN></P>',
